import "./NavBar.scss";
import Scroll from "react-scroll";

const Link:any = Scroll.ScrollLink;


const NavBar = () => {
  return (
    <nav className="nav">
      <ul>
        <Link
        to="landingPage"
        spy={true}
        smooth={true}
        duration={400}
        className="class-name"
        activeClass="active-class-name"
        >Home</Link>
        <Link>About</Link>
        <li>Work</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
};

export default NavBar;
